    <div>
      <img
        src="https://sun1-27.userapi.com/s/v1/ig2/tQuE_wC8TVMp8vjRyRZ43iKM3hOcBNBPeV75LeH1lp7xBiR1ebdU0gUw7c9XXeLJ43ThAT46MA2MpYF2dCLSiUh3.jpg?size=100x0&quality=96&crop=180,223,1387,1387&ava=1"
        alt="user photo"
      />
    </div>
  );
};

export default UserCard;
